import React, { Component } from 'react';
import ReactDOM from 'react-dom';
import "react-responsive-carousel/lib/styles/carousel.min.css";
import { Carousel } from 'react-responsive-carousel';

class DetailHeroCarousel extends Component {
    render() {
        return (
            <Carousel>
                <div>
                    <img src="https://i.picsum.photos/id/237/200/300.jpg"/>
                    <p className="legend">Legend 1</p>
                </div>
                <div>
                    <img src="https://i.picsum.photos/id/238/200/300.jpg" />
                    <p className="legend">Legend 2</p>
                </div>
                <div>
                    <img src="https://i.picsum.photos/id/239/200/300.jpg" />
                    <p className="legend">Legend 3</p>
                </div>
            </Carousel>
        );
    }
}

export default DetailHeroCarousel
